import { getUsersRequest } from '../api/recet.api'
import Layout from '../components/Layout'

function Home() {

const [users, setUsers] = useState([])

useEffect(()=>{

 async function loadUsers(){
  const response = await getUsersRequest()
  setUsers(response.data)

  }
  loadUsers()

}, [])

  return (
    <div>
      <h1>
        HOme
        </h1>




      <Layout />


    </div>
  )
}

export default Home
